import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const heading = {
  fontFamily: '"Bebas Neue", cursive',
  color: "#ffffffeee",
  fontSize: "1200%",
  textAlign: "center",
  margin: "400px 0",
};

let curDate = new Date();
curDate = curDate.getHours;

ReactDOM.render(
  <h1 style={heading}> Hello Sir, {curDate}</h1>,
  document.getElementById("root")
);
